import styled from 'styled-components'

const Div = styled.div`
    border-style: solid;
    width: 12em;
    height: 8em;
    margin: 1em;

    .p {
        margin: 0px;
    }

`;

const Counter = ( { title='Orders on Queue', endpoint } ) => {
    return (
        <Div>
            <p>{title}</p>
            <p>0000</p>
        </Div>
    )
}

export default Counter
